const curriculum = {
    "properties": [
        {
            "index": 0,
            "title": "Full Stack Web Development & Web Apps",
            "sections": [
                "HTML & CSS",
                "JavaScript",
                "ReactJs & AngularJs",
                "NodeJs",
                "PHP & Laravel",

            ]
        },
        {
            "index": 1,
            "title": "UI/UX Design",
            "sections": [
                "Coming Soon!!"
            ]
        },
        {
            "index": 2,
            "title": "Mobile App Development",
            "sections": [
                ["Android Development"],
                ["iOS development"]
            ]
        },
        {
            "index": 3,
            "title": "Data science",
            "sections": [
                "Coming Soon!!"
            ]
        },
        {
            "index": 4,
            "title": "Artificial Intelligence (AI)",
            "sections": [
                ["Machine Learning"],
                ["Deep Learning"]
            ]
        }
    ]
}

export default curriculum;
